// @ts-nocheck
import React, { useState} from 'react';
import styles from './Hero.module.css';

function Hero (){
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    age: '',
    address: '',
    homeroomClassNumber: '',
    studentID: ''
  })
  function handleChange (e, field) {
    setFormData({
      ...formData,
      [field]: e.target.value
    });
  }
  return(
    <>
    <form>
      <input value={formData.firstName} onChange={(e) => handleChange(e, 'firstName')} />
      <input value={formData.lastName} onChange={(e) => handleChange(e, 'lastName')} />
      <input value={formData.age} onChange={(e) => handleChange(e, 'age')} />
      <input value={formData.address} onChange={(e) => handleChange(e, 'address')} />
      <input value={formData.homeroomClassNumber} onChange={(e) => handleChange(e, 'homeroomClassNumber')} />
      <input value={formData.studentID} onChange={(e) => handleChange(e, 'studentID')} />
    </form>
    <div className={styles.grid}> 
    <h1 className={styles.gridName}>first name: {formData.firstName} <br /> last name: {formData.lastName}</h1>
    <h3>age: {formData.age}</h3>
    <h6>address: {formData.address}</h6>
    <p>homeroom class number: {formData.homeroomClassNumber}</p>
    <p>student ID: {formData.studentID}</p>
    </div>
    </>
    )
}




















export default Hero;
